import React from 'react';
import tinkerImg from '../../Assets/Projects/tinker.png';

function Tinker() {
    return (
        <div>
            <h1>Tinker</h1>
            <p>End-to-End Mobile App Design</p>
            <img src={tinkerImg} className="headerImage"/>
        </div>
    );
}

export default Tinker;
